import { Movie } from "@mui/icons-material";
import { React, useState } from "react";
import { PPAL, PPALLayout, VerticalMovieCard } from "./MovieInfo.style";
import { MovieImg, MovieRating, MovieTitle, StarRating } from "~/components/ReviewForm/ReviewForm.style";
import naruto from 'src/assets/images/naruto.png';
import { Link } from "react-router-dom";
import ReturnBlock from "~/components/ReturnLink/Return";
import { ReviewLayout } from "../Review/Review.style";

const MovieInfo = () => {
    const [rating] = useState(1);
    return (
        <ReviewLayout>
            <Link to='/' style={{ 
                textDecoration:'none', 
                width:'400px', 
                padding:'80px 2.5% 15px' 
            }}>
                <ReturnBlock backmessage="Back to homepage" />
            </Link>
            <VerticalMovieCard>
                <MovieImg src={naruto} alt="Movie Picture" />
                <Movie>
                    
                </Movie>
            </VerticalMovieCard>
                <PPALLayout class="PPAL">
                    <PPAL>
                        <h3>People also like</h3>
                    </PPAL>
                </PPALLayout>
        </ReviewLayout>
    );
};
export default MovieInfo;
